-- SCRIPT BASE DE DATOS

-- Create the database
CREATE DATABASE [Pomaray Bank];
GO

-- Use the created database
USE [Pomaray Bank];
GO

-- Create the Clientes table
CREATE TABLE Clientes (
                          ClienteID INT PRIMARY KEY IDENTITY(1,1),
                          Primer_Nombre VARCHAR(100) NOT NULL,
                          Segundo_Nombre VARCHAR(100) NOT NULL,
                          Primer_Apellido VARCHAR(100) NOT NULL,
                          Segundo_Apellido VARCHAR(100) NOT NULL,
                          Email VARCHAR(100)
);
GO

-- Create the TiposCuentas table
CREATE TABLE TiposCuentas (
                              TipoCuentaID INT PRIMARY KEY IDENTITY(1,1),
                              TipoCuenta VARCHAR(50)
);
GO

-- Create the TiposTransacciones table
CREATE TABLE TiposTransacciones (
                                    TipoTransaccionID INT PRIMARY KEY IDENTITY(1,1),
                                    TipoTransaccion VARCHAR(50)
);
GO

-- Create the Cuentas table
CREATE TABLE Cuentas (
                         CuentaID INT PRIMARY KEY IDENTITY(1,1),
                         ClienteID INT,
                         TipoCuentaID INT,
                         Saldo DECIMAL(10, 2) DEFAULT 0.00,
                         FOREIGN KEY (ClienteID) REFERENCES Clientes(ClienteID) ON DELETE CASCADE,
                         FOREIGN KEY (TipoCuentaID) REFERENCES TiposCuentas(TipoCuentaID)
);
GO

-- Create the Transacciones table
CREATE TABLE Transacciones (
                               TransaccionID INT PRIMARY KEY IDENTITY(1,1),
                               CuentaID INT,
                               Fecha DATE,
                               Monto DECIMAL(10, 2),
                               TipoTransaccionID INT,
                               FOREIGN KEY (CuentaID) REFERENCES Cuentas(CuentaID) ON DELETE CASCADE,
                               FOREIGN KEY (TipoTransaccionID) REFERENCES TiposTransacciones(TipoTransaccionID)
);
GO

-- Create the Contactos table
CREATE TABLE Contactos (
                           ContactoID INT PRIMARY KEY IDENTITY(1,1),
                           ClienteID INT,
                           Direccion VARCHAR(255),
                           Telefono VARCHAR(15),
                           FOREIGN KEY (ClienteID) REFERENCES Clientes(ClienteID) ON DELETE CASCADE
);
GO

-- Create the TarjetasCredito table
CREATE TABLE TarjetasCredito (
                                 TarjetaID INT PRIMARY KEY IDENTITY(1,1),
                                 ClienteID INT,
                                 NumeroTarjeta VARCHAR(20) NOT NULL,
                                 FechaExpiracion DATE NOT NULL,
                                 CVV VARCHAR(4) NOT NULL,
                                 LimiteCredito DECIMAL(10, 2) NOT NULL,
                                 Saldo DECIMAL(10, 2) DEFAULT 0.00,
                                 FOREIGN KEY (ClienteID) REFERENCES Clientes(ClienteID) ON DELETE CASCADE
);
GO







